import React from 'react';
import './contact.css';


function Contact() {
    return (
        <div className='page'>
            <h1>Contact</h1>
            <div className='button-group'>
                <button className='LinkedIn'>
                <i class="fa-brands fa-linkedin" ></i>
                </button>
                <button className='GitHub'>
                    {/* <i class="fa-brands fa-github"  ></i> */}
                </button>
            </div>

        </div>  );
}

export default Contact;
